package main

import "fmt"

func dailyTemperatures(T []int) []int {
	res := make([]int, len(T))
	for i := 0; i < len(T); i++ {
		for j := i+1; j < len(T); j++ {
			if T[i] < T[j] {
				res[i] = j - i
				break
			}
		}
	}

	return res
}

type Tem struct {
	k int
	v int
}

func dailyTemperatures_stack(T []int) []int {
	length := len(T)
	res := make([]int, length)
	stack := []Tem{}
	for i := 0; i < length; i++ {
		for len(stack) > 0 {
			if T[i] > stack[len(stack)-1].v {
				res[stack[len(stack)-1].k] = i - stack[len(stack)-1].k
				stack = stack[:len(stack)-1]
			} else {
				break
			}
		}
		tem := Tem{
			k: i,
			v: T[i],
		}
		stack = append(stack, tem)
 	}
	return res
}

